///Developer:Chris Riedl
///Name:GranlarDataReport
///Created:2020-05-26

select Distinct

"ESend"."CONTACTID"
,"ESend"."EMAILADDRESS"
,"CON"."COUNTRY"
,"1W"."Subject"
,"CAMP"."BUSINESS_UNIT"
,"ESend"."CAMPAIGNNAME"
,"ESend"."CAMPAIGNID"
,"ESend"."ACTIVITYDATE" as "EmailSendDate"
,"ESend"."EmailName"
,"ESend"."EmailID"
,"ESend"."UniqueSendID"
,"EOpen"."EmailOpens"
,"EClick"."Clicks"
,"BOU"."BounceBack"


///From Statement Defines the email send info
From (Select "ES"."CONTACTID"
            ,"ES"."EMAILADDRESS"
            ,"ES"."CAMPAIGNNAME"
            ,"ES"."ACTIVITYDATE"
            ,"ES"."ASSETID" as "EmailID"
            ,"ES"."ASSETNAME" as "EmailName"
            ,"ES"."CAMPAIGNID"
            ,CONCAT("ES"."CAMPAIGNID", '.',"ES"."ASSETID",'.',"ES"."CONTACTID") as "UniqueSendID"
            from "DEV_EDW"."CUST360"."T_S_EMAILSEND" as "ES") as "ESend"
            
///Left Join brings in the Open Count based on Unique Identifier created join CampaignID, EmailID & Contact ID
Left join (Select 

            CONCAT("EO"."CAMPAIGNID", '.',"EO"."ASSETID",'.',"EO"."CONTACTID") as "UniqueSendID"
            ,count("EO"."ACTIVITYID") as "EmailOpens"

            from "DEV_EDW"."CUST360"."T_S_EMAILOPEN" as "EO"

            group by CONCAT("EO"."CAMPAIGNID", '.',"EO"."ASSETID",'.',"EO"."CONTACTID")) as "EOpen"
            
            On "EOpen"."UniqueSendID" = "ESend"."UniqueSendID"

///Left Join brings in the Click Count based on Unique Identifier created join CampaignID, EmailID & Contact ID
Left Join (Select 

            CONCAT("EC"."CAMPAIGNID", '.',"EC"."ASSETID",'.',"EC"."CONTACTID") as "UniqueSendID"
            ,count("EC"."ACTIVITYID") as "Clicks"

            from "PROD_EDW"."CUST360"."T_S_EMAILCLICKTHROUGH" as "EC"

            group by CONCAT("EC"."CAMPAIGNID", '.',"EC"."ASSETID",'.',"EC"."CONTACTID")) as "EClick"
            
            On "EClick"."UniqueSendID" = "ESend"."UniqueSendID"
            
// Join in BounceBacks
Left Join (Select 

            CONCAT("CAMPAIGNID", '.',"ASSETID",'.',"CONTACTID") as "UniqueSendID"
            ,count("ACTIVITYID") as "BounceBack"

            from "PROD_EDW"."CUST360"."T_S_BOUNCEBACK" 

            group by CONCAT("CAMPAIGNID", '.',"ASSETID",'.',"CONTACTID")) as "BOU"
            
            On "BOU"."UniqueSendID" = "ESend"."UniqueSendID"
            
// Join Campaign Info
left join (select "ELOQUA_CAMPAIGN_ID"
                ,"BUSINESS_UNIT"

            from "T_S_CAMPAIGN") as "CAMP"
            
            on "CAMP"."ELOQUA_CAMPAIGN_ID" = "ESend"."CAMPAIGNID"
         
            
// Join Country Info            
Left Join ( Select 
            "CONTACT_ID"
            ,"COUNTRY"

            from "PROD_EDW"."CUST360"."T_S_CONTACT") as "CON"
            
            on "CON"."CONTACT_ID" = "ESend"."CONTACTID"
//Join in Subject on Interest
Left Join (select distinct "EMAIL_ADDRESS"
                ,"ZMERGE_TEXT" as "Subject"

           from "T_S_ONEWILEY_GLOB_PREFERENCE") as "1W"
           
           On "1W"."EMAIL_ADDRESS" = "ESend"."EMAILADDRESS"
           
